<script>

var params = {
        container: document.getElementById('lottie'),
        renderer: 'svg',
        loop: false,
        autoplay: false,
        path: './data.json'
    };

    var anim;

    anim = lottie.loadAnimation(params);

    anim.addEventListener("DOMLoaded", function(){
        // Click Tag
        document.getElementById('border').onclick = function(){
            window.open(window.clickTag);
        }
        play()
    })

    // Play Animation start/stop
    function play (){
        canMouseOver = false;
        anim.playSegments([[0,360]], true);
        
    }
    
    var banner = document.getElementById('lottie');
    var canMouseOver = false;

    banner.addEventListener("mouseenter", function( event ) {
        if(anim.currentFrame >=360){
            canMouseOver = true;
        }
        if(canMouseOver){
            // Mouse over Animation Start/Stop
            anim.playSegments([[645,660]], true)
        }
    })

    banner.addEventListener("mouseleave", function( event ) {
        if(canMouseOver){
            // Mouse over Animation Start/Stop
            anim.playSegments([[695,710]], true)
        }
    })

    // Handler for Re-Play Button
    anim.addEventListener("enterFrame", function( event ){
        if(anim.currentFrame >=360){
            document.getElementById('replay').onclick = play;
        }
        
    })

</script>
